package main
import (
  "bytes"
  "compress/gzip"
  "encoding/base64"
  "io"
  "github.com/computeportal/glui"
)
const (
  rabbit_data =""
)
var rabbit = &glui.ImageData{nil, 650, 476}
func load_rabbit() bool {
  b, err := base64.StdEncoding.DecodeString(rabbit_data)
  if err != nil {panic(err)}
  r, err := gzip.NewReader(bytes.NewBuffer(b))
  if err != nil {panic(err)}
  c := &bytes.Buffer{}
  io.Copy(c, r)
  rabbit.Pix = c.Bytes()
  return true
}
var rabbit_loaded = load_rabbit()